import base64
import tempfile
import wave

# Your Base64 string
base64_str = """"""


# 2. Decode the raw Base64 to binary data
audio_buffer = base64.b64decode(base64_str[4:])
# with tempfile.NamedTemporaryFile(suffix='.wav') as f, wave.open(f.name, 'wb') as wf:
with wave.open("output.wav", 'wb') as wf:
    wf.setnchannels(1)
    wf.setsampwidth(2)
    wf.setframerate(48000)
    wf.writeframes(audio_buffer)


